		protected void UpdateSelections()
		{
			WebListBox.SelectedIndexChanged -= WebListBox_SelectedIndexChanged;
			SystemListBox.SelectedIndexChanged -= SystemListBox_SelectedIndexChanged;
			try
			{
				((ListControl)WebListBox).SelectedIndex = -1;
				((ListControl)SystemListBox).SelectedIndex = -1;
				m_CustomSelectedIndex = -1;
				m_InitialActivePageindex = 0;
				for (int i = 0; i < m_CustomColorArray.Length; i++)
				{
					if (m_CustomColorArray[i].ToArgb() == Color.ToArgb())
					{
						m_CustomSelectedIndex = i;
						m_InitialActivePageindex = 0;
						break;
					}
				}
				if (Color.IsSystemColor)
				{
					for (int j = 0; j < SystemListBox.Items.Count; j++)
					{
						string name = SystemListBox.Items[j].ToString();
						Color color = Color.FromName(name);
						if (color == Color)
						{
							((ListControl)SystemListBox).SelectedIndex = j;
							m_InitialActivePageindex = 2;
							break;
						}
					}
				}
				for (int k = 0; k < WebListBox.Items.Count; k++)
				{
					string name = WebListBox.Items[k].ToString();
					if (Color.FromName(name).ToArgb() == Color.ToArgb())
					{
						((ListControl)WebListBox).SelectedIndex = k;
						m_InitialActivePageindex = 1;
						break;
					}
				}
			}
			finally
			{
				WebListBox.SelectedIndexChanged += WebListBox_SelectedIndexChanged;
				SystemListBox.SelectedIndexChanged += SystemListBox_SelectedIndexChanged;
			}
		}

