		}

		private void ResetWidthMin()
		{
			PropertyReset("WidthMin");
		}

		private int GetRequiredWidth(PaintArgs p, Font font, PercentItemCollection items, bool isValue)
		{
			if (!Visible)
			{
				return 0;
			}
			int num = (int)((double)p.Graphics.MeasureString("0", font, typographic: true).Width * WidthMin);
			int num2 = (int)((double)p.Graphics.MeasureString("0", font, typographic: true).Width * Margin);
			foreach (PercentItem item in items)
			{
				string text = ((!isValue) ? Format.GetText(items.GetItemPercent(item) * 100.0) : Format.GetText(item.Value));
				int width = p.Graphics.MeasureString(text, font, typographic: true).Width;
				if (width > num)
				{
					num = width;
				}
			}
			return num + num2;
		}
	}
