			}
			set
			{
				PropertyUpdateDefault("On", value);
				if (On != value)
				{
					m_On = value;
					if (!base.Designing)
					{
						m_Timer.Enabled = value;
					}
					DoPropertyChange(this, "On");
				}
			}
		}

		private int FrameNumber
		{
			get
			{
				return m_FrameNumber;
			}
			set
			{
				if (value > FrameCount - 1)
				{
					value = 0;
				}
				if (value < 0)
				{
					value = FrameCount - 1;
				}
				if (FrameCount == 0)
				{
					value = -1;
				}
				if (FrameNumber != value)
				{
					m_FrameNumber = value;
					OnFrameChanged();
					DoPropertyChange(this, "FrameNumber");
				}
			}
		}

		private int FrameCount
		{
			get
			{
				return m_FrameCount;
			}
			set
			{
				if (FrameCount != value)
				{
					m_FrameCount = value;
					((IAnimation)this).FrameNumber = ((IAnimation)this).FrameNumber;
					DoPropertyChange(this, "FrameCount");
				}
			}
		}

