		{
			base.CreateObjects();
			m_Timer = new Timer();
			m_Timer.Elapsed += TimerElapsed;
			m_Timer.Enabled = false;
		}

		public void Dispose()
		{
			if (m_Timer != null)
			{
				m_Timer.Enabled = false;
				m_Timer.Dispose();
				m_Timer = null;
			}
		}

