		{
			PropertyReset("FixedLength");
		}

		public static string ToString(long value, TextFormatIntegerStyle style, int fixedLength, LeadingStyle leadingStyle)
		{
			long num = ((style != TextFormatIntegerStyle.Integer) ? value : Math.Abs(value));
			string text;
			switch (style)
			{
			case TextFormatIntegerStyle.Binary:
				text = Convert2.ToString(num, 2);
				break;
			case TextFormatIntegerStyle.Octal:
				text = Convert2.ToString(num, 8);
				break;
			case TextFormatIntegerStyle.Integer:
				text = Convert2.ToString(num, 10);
				break;
			case TextFormatIntegerStyle.Hexadecimal:
				text = Convert2.ToString(num, 16);
				break;
			default:
				return "Not-Supported";
			}
			text = text.ToUpper(CultureInfo.CurrentCulture);
			if (fixedLength != 0)
			{
				string value2 = ((value < 0) ? (style switch
				{
					TextFormatIntegerStyle.Binary => "1", 
					TextFormatIntegerStyle.Octal => "7", 
					TextFormatIntegerStyle.Integer => "0", 
					TextFormatIntegerStyle.Hexadecimal => "F", 
					_ => "0", 
				}) : ((leadingStyle != LeadingStyle.Zeros) ? " " : "0"));
				if (text.Length > fixedLength)
				{
					text = text.Substring(text.Length - fixedLength, fixedLength);
				}
				StringBuilder stringBuilder = new StringBuilder(text);
				for (int i = 0; i < fixedLength - text.Length; i++)
				{
					stringBuilder.Insert(0, value2);
				}
				text = stringBuilder.ToString();
			}
			if (style == TextFormatIntegerStyle.Integer && value < 0)
			{
				text = '-' + text;
			}
			return text;
		}

		public static long ToLong(string s, TextFormatIntegerStyle style)
		{
			if (s.Length == 0)
			{
				return 0L;
			}
			return style switch
			{
				TextFormatIntegerStyle.Binary => (int)Convert.ToInt64(s, 2), 
				TextFormatIntegerStyle.Octal => (int)Convert.ToInt64(s, 8), 
				TextFormatIntegerStyle.Integer => (int)Convert.ToInt64(s, 10), 
				TextFormatIntegerStyle.Hexadecimal => (int)Convert.ToInt64(s, 16), 
				_ => 0L, 
			};
		}

		public string GetText(long value)
		{
			return ToString(value, Style, FixedLength, LeadingStyle.Zeros);
		}

		public long GetValue(string s)
		{
			return ToLong(s, Style);
		}
	}
