		private bool ShouldSerializeStyle()
		{
			return PropertyShouldSerialize("Style");
		}

		private void ResetStyle()
		{
			PropertyReset("Style");
		}

		protected override string GetActualPrecisionString(double value)
		{
			if (base.PrecisionStyle == PrecisionStyle.None)
			{
				return "";
			}
			if (base.PrecisionStyle == PrecisionStyle.FixedDecimalPoints)
			{
				return Convert2.ToString(base.Precision);
			}
			int num;
			if (Style == TextFormatDoubleStyle.Exponent)
			{
				num = base.Precision - 1;
				if (num < 0)
				{
					num = 0;
				}
				return Convert2.ToString(num);
			}
			int num2 = ((value != 0.0) ? ((int)Math.Log10(Math.Abs(value)) + 1) : 0);
			num = base.Precision - num2;
			if (num < 0)
			{
				num = 0;
			}
			return Convert2.ToString(num);
		}

		public override string GetText(double value)
		{
			double num = Math.Abs(value);
			int num2 = ((!(num < 1.0)) ? ((int)Math.Log10(Math.Abs(value)) + 1) : 0);
			if (num2 < 12 && !double.IsInfinity(value) && !double.IsNaN(value))
			{
				value = Math.Round(value, 12 - num2);
			}
			switch (Style)
			{
			case TextFormatDoubleStyle.Number:
			{
				if (base.PrecisionStyle == PrecisionStyle.None)
				{
					return string.Format(CultureInfo.CurrentCulture, "{0:G}" + base.UnitsText, new object[1] { value });
				}
				string actualPrecisionString = GetActualPrecisionString(value);
				return string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "}" + base.UnitsText, new object[1] { value });
			}
			case TextFormatDoubleStyle.Thousands:
			{
				string actualPrecisionString = GetActualPrecisionString(value);
				return string.Format(CultureInfo.CurrentCulture, "{0:n" + actualPrecisionString + "}" + base.UnitsText, new object[1] { value });
			}
			case TextFormatDoubleStyle.Exponent:
			{
				string actualPrecisionString = GetActualPrecisionString(value);
				return string.Format(CultureInfo.CurrentCulture, "{0:e" + actualPrecisionString + "}" + base.UnitsText, new object[1] { value });
			}
			case TextFormatDoubleStyle.DateTime:
			{
				DateTime dateTime = Math2.DoubleToDateTime(value);
				if (DateTimeFormat.IndexOf('f') != -1)
				{
					return dateTime.ToString(DateTimeFormat, CultureInfo.CurrentCulture);
				}
				return dateTime.AddMilliseconds(5.0).ToString(DateTimeFormat, CultureInfo.CurrentCulture);
			}
			case TextFormatDoubleStyle.DateTimeUTC:
			{
				DateTime dateTime2 = Math2.DoubleToDateTime(value).ToLocalTime();
				if (DateTimeFormat.IndexOf('f') != -1)
				{
					return dateTime2.ToString(DateTimeFormat, CultureInfo.CurrentCulture);
				}
				return dateTime2.AddMilliseconds(5.0).ToString(DateTimeFormat, CultureInfo.CurrentCulture);
			}
			case TextFormatDoubleStyle.Prefix:
			{
				int num6 = (int)(Math.Log10(Math.Abs(value)) / 3.0) * 3;
				num = value / Math.Pow(10.0, num6);
				string actualPrecisionString = GetActualPrecisionString(num);
				return num6 switch
				{
					24 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} Y" + base.UnitsText, new object[1] { num }), 
					21 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} Z" + base.UnitsText, new object[1] { num }), 
					18 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} E" + base.UnitsText, new object[1] { num }), 
					15 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} P" + base.UnitsText, new object[1] { num }), 
					12 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} T" + base.UnitsText, new object[1] { num }), 
					9 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} G" + base.UnitsText, new object[1] { num }), 
					6 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} M" + base.UnitsText, new object[1] { num }), 
					3 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} K" + base.UnitsText, new object[1] { num }), 
					0 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "}" + base.UnitsText, new object[1] { num }), 
					-3 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} m" + base.UnitsText, new object[1] { num }), 
					-6 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} " + base.UnitsText, new object[1] { num }), 
					-9 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} n" + base.UnitsText, new object[1] { num }), 
					-12 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} p" + base.UnitsText, new object[1] { num }), 
					-15 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} f" + base.UnitsText, new object[1] { num }), 
					-18 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} a" + base.UnitsText, new object[1] { num }), 
					-21 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} z" + base.UnitsText, new object[1] { num }), 
					-24 => string.Format(CultureInfo.CurrentCulture, "{0:f" + actualPrecisionString + "} y" + base.UnitsText, new object[1] { num }), 
					_ => string.Format(CultureInfo.CurrentCulture, "{0:e" + actualPrecisionString + "}" + base.UnitsText, new object[1] { value }), 
				};
			}
			case TextFormatDoubleStyle.Price32nds:
			{
				double num3 = value - (double)(int)value;
				int num4 = (int)(num3 * 32.0);
				int num5 = (int)((num3 - (double)num4 / 32.0) * 256.0);
				string text = num4.ToString("d", CultureInfo.CurrentCulture);
				string text2 = num5.ToString("d", CultureInfo.CurrentCulture);
				if (text.Length < 2)
				{
					text = "0" + text;
				}
				return string.Format(CultureInfo.CurrentCulture, "{0:f0}." + text + text2 + " " + base.UnitsText, new object[1] { (int)(value + 0.0) });
			}
			default:
				return "Error";
			}
		}
	}
