			Point point = ((Control)this).PointToClient(Control.MousePosition);
			int colorBoxIndex = GetColorBoxIndex(point.X, point.Y);
			if (colorBoxIndex != -1)
			{
				OnColorChangedDoubleClick();
			}
		}

		protected override void OnLostFocus(EventArgs e)
		{
