				}
			}
		}

		[Category("Iocomp")]
		[Description("")]
		public double AngleMax => Math2.AngleNormalized(m_AngleMin - m_AngleSpan);

		[Category("Iocomp")]
		[RefreshProperties(RefreshProperties.All)]
		[Description("")]
		public double AngleSpan
		{
			get
			{
				return m_AngleSpan;
			}
			set
			{
				PropertyUpdateDefault("AngleSpan", value);
				if (value < 0.0)
				{
					ThrowStreamingSafeException("AngleSpan value must be 0 or greater.");
				}
				if (value < 0.0)
				{
					value = 0.0;
				}
				if (value > 360.0)
				{
					ThrowStreamingSafeException("AngleSpan value must be 360 or less.");
				}
				if (value > 360.0)
				{
					value = 360.0;
				}
				if (AngleSpan != value)
				{
					m_AngleSpan = value;
					DoPropertyChange(this, "AngleSpan");
				}
			}
		}

