			if (((ListControl)ItemListBox).SelectedIndex == -1)
			{
				((Control)MoveDownButton).Enabled = false;
			}
			if (((ListControl)ItemListBox).SelectedIndex == 0)
			{
				((Control)MoveUpButton).Enabled = false;
			}
			if (((ListControl)ItemListBox).SelectedIndex == ItemListBox.Items.Count - 1)
			{
				((Control)MoveDownButton).Enabled = false;
			}
