		public static Color Darken4(Color color)
		{
			return Darken(color, 0.75f);
		}

		public static Color ToCornerHighlight(Color color)
		{
			return Lighten(color, 0.6f);
		}

		public static Color ToCornerShadow(Color color)
		{
			return Darken(color, 0.05f);
		}

		public static Color ToBright(Color color)
		{
			return ColorOffset(color, 128);
		}

		public static Color ToDim(Color color)
		{
			return ColorOffset(color, -128);
		}

		public static Color ToOffColor(Color color)
		{
			return ToDim(color);
		}

		public static Color ToFaceColor(FaceReference side, RotationQuad rotation, bool invert)
		{
			if (side == FaceReference.Flat)
			{
				return FaceColorFlat;
			}
			if (invert)
			{
				switch (side)
				{
				case FaceReference.Left:
					side = FaceReference.Right;
					break;
				case FaceReference.Top:
					side = FaceReference.Bottom;
					break;
				case FaceReference.Right:
					side = FaceReference.Left;
					break;
				case FaceReference.Bottom:
					side = FaceReference.Top;
					break;
				}
			}
			switch (rotation)
			{
			case RotationQuad.X000:
				switch (side)
				{
				case FaceReference.Left:
					return FaceColorLight;
				case FaceReference.Top:
					return FaceColorLight;
				case FaceReference.Right:
					return FaceColorDark;
				case FaceReference.Bottom:
					return FaceColorDark;
				}
				break;
			case RotationQuad.X090:
				switch (side)
				{
				case FaceReference.Left:
					return FaceColorLight;
				case FaceReference.Top:
					return FaceColorDark;
				case FaceReference.Right:
					return FaceColorDark;
				case FaceReference.Bottom:
					return FaceColorLight;
				}
				break;
			case RotationQuad.X180:
				switch (side)
				{
				case FaceReference.Left:
					return FaceColorDark;
				case FaceReference.Top:
					return FaceColorDark;
				case FaceReference.Right:
					return FaceColorLight;
				case FaceReference.Bottom:
					return FaceColorLight;
				}
				break;
			default:
				switch (side)
				{
				case FaceReference.Left:
					return FaceColorDark;
				case FaceReference.Top:
					return FaceColorLight;
				case FaceReference.Right:
					return FaceColorLight;
				case FaceReference.Bottom:
					return FaceColorDark;
				}
				break;
			}
			return Color.Black;
		}
	}
	public sealed class UpdateRateTimer
	{
		private static Timer m_Timer;

		private static ArrayList m_ControlList;

		static UpdateRateTimer()
		{
			m_ControlList = new ArrayList();
		}

		public static void AddControl(IUpdateRate update)
		{
			//IL_0013: Unknown result type (might be due to invalid IL or missing references)
			//IL_001d: Expected O, but got Unknown
			m_ControlList.Add(update);
			if (m_Timer == null)
			{
				m_Timer = new Timer();
				m_Timer.Interval = 100;
				m_Timer.Enabled = true;
				m_Timer.Tick += m_Timer_Tick;
			}
		}

		public static void RemoveControl(IUpdateRate update)
		{
			m_ControlList.Remove(update);
			if (m_ControlList.Count == 0)
			{
				m_Timer.Enabled = false;
				((Component)(object)m_Timer).Dispose();
				m_Timer = null;
			}
		}

		public static bool NeedsUpdate(IUpdateRate update)
		{
			if (update.FrameRate == 0.0)
			{
				return false;
			}
			if (update.Active)
			{
				return false;
			}
			if (!update.Needed)
			{
				return false;
			}
			DateTime now = DateTime.Now;
			if (Math2.DateTimeToDouble(now) > Math2.DateTimeToDouble(update.LastRepaintTime) + 1.0 / update.FrameRate * 1.0 / 86400.0)
			{
				return true;
			}
			return false;
		}

		private static void m_Timer_Tick(object sender, EventArgs e)
		{
			foreach (IUpdateRate control in m_ControlList)
			{
				if (NeedsUpdate(control))
				{
					control.InvalidateControl();
				}
			}
		}
	}
