		private Point GetTickPoint(IScaleTickBase tick, float radius)
		{
			double angle = I_Range.ValueToAngle(tick.Value);
			double num = ((tick is ScaleTickMinor) ? (tick as ScaleTickMinor).Alignment : ((tick is ScaleTickMid) ? (tick as ScaleTickMid).Alignment : AlignmentStyle.Near)) switch
			{
				AlignmentStyle.Center => (float)(base.TickMajor.Length - tick.Length) / 2f, 
				AlignmentStyle.Far => base.TickMajor.Length - tick.Length, 
				_ => 0.0, 
			};
			return Math2.ToRotatedPoint(angle, (double)(radius + (float)Margin) + num, CenterPoint);
		}

