				string plugInClassName = (m_OriginalInstance as ISupportUITypeEditor).GetPlugInClassName();
				if (plugInClassName != string.Empty)
				{
					Assembly[] assemblies = AppDomain.CurrentDomain.GetAssemblies();
					foreach (Assembly assembly in assemblies)
					{
						if (assembly is AssemblyBuilder)
						{
							continue;
						}
						Type[] types = assembly.GetTypes();
						bool flag = false;
						Type[] array = types;
						foreach (Type type in array)
						{
							if (type.FullName == plugInClassName)
							{
								flag = true;
								break;
							}
						}
						if (flag)
						{
							m_MainPlugIn = (PlugInStandard)Activator.CreateInstance(assembly.FullName, plugInClassName).Unwrap();
						}
					}
				}
			}
			if (m_OriginalInstance is SubClassBase)
			{
				m_MainPlugInTabName = "General";
			}
			else
			{
				m_MainPlugInTabName = "Control";
			}
		}

