			PropertyReset("FixedSize");
		}

		protected override void DrawCustom(PaintArgs p)
		{
			float num = Scale.ConvertHeightUnitsToPixels(Height);
			float num2 = Scale.ConvertWidthUnitsToPixels(Width);
			if (ImageListActive != null && ImageIndex > -1 && ImageIndex < ImageListActive.Images.Count)
			{
				Image val = ImageListActive.Images[ImageIndex];
				float num3;
				float num4;
				if (!FixedSize)
				{
					num3 = num / (float)val.Height * (float)val.Height;
					num4 = num2 / (float)val.Width * (float)val.Width;
				}
				else
				{
					num3 = val.Height;
					num4 = val.Width;
				}
				Rectangle r = new Rectangle((int)((float)Scale.ConvertUnitsToPixelsX(X) - num4 / 2f), (int)((float)Scale.ConvertUnitsToPixelsY(Y) - num3 / 2f), (int)num4 + 1, (int)num3 + 1);
				base.ClickRegion = ToClickRegion(r);
				UpdateGrabHandles(r);
				p.Graphics.DrawImageTransparent(val, r);
			}
		}

		public override string ToString()
		{
			return "Annotation Image";
		}
	}
