			int x = (r.Left + r.Right) / 2;
			int y = (r.Top + r.Bottom) / 2;
			ref Point reference = ref array[0];
			reference = new Point(r.Left, y);
			ref Point reference2 = ref array[1];
			reference2 = new Point(x, r.Top);
			ref Point reference3 = ref array[2];
			reference3 = new Point(r.Right, y);
			ref Point reference4 = ref array[3];
			reference4 = new Point(x, r.Bottom);
			p.Graphics.FillPolygon(p.Graphics.Brush(color), array);
		}

