				BorderSpecial.DrawRectangle(p, r, BevelStyle.Raised, p.Width / 10, Bezel.Color);
				break;
			case IndicatorStyleLED3D.Thin:
				BorderSpecial.DrawRectangle(p, r, BevelStyle.Raised, 2, Bezel.Color);
