		public bool LabelsFit(double span, double increment)
		{
			double num = span / increment;
			if (num > 1000.0)
			{
				return false;
			}
			MajorStepSize = increment;
			MajorCount = (int)num;
			if (MidIncluded && 2 * MajorCount - 1 <= MaxTicks)
			{
				return true;
			}
			if (MajorCount <= MaxTicks)
			{
				return true;
			}
			return false;
		}
	}
