				AlignmentQuadSide.Right => new Point[3]
				{
					new Point(r.Right + 1, r.Top),
					new Point(r.Left + r.Width / 2, r.Top + r.Height / 2),
					new Point(r.Right + 1, r.Bottom + 1)
				}, 
