					((ListControl)this).SelectedIndex = (int)displayValue;
					m_BlockEvents = false;
				}
				else if (displayValue is string)
				{
					((ComboBox)this).DropDownStyle = (ComboBoxStyle)1;
					((Control)this).Text = (string)displayValue;
				}
				else
				{
					flag = false;
				}
			}
			IsValid = flag;
		}

		private void DownloadDisplay(object target)
		{
			if (!IsValid)
			{
				return;
			}
			object displayValue = PropertyAdapter.GetDisplayValue(target);
			if (displayValue != null)
			{
				if (PropertyAdapter.GetIsEnum(target))
				{
					PropertyAdapter.SetValue(target, Enum.Parse(displayValue.GetType(), (string)((ComboBox)this).Items[((ListControl)this).SelectedIndex]));
				}
				else if (displayValue is string)
				{
					PropertyAdapter.SetValue(target, ((Control)this).Text);
				}
			}
		}

		private bool GetIsDisplayDirty(object original)
		{
			object displayValue = PropertyAdapter.GetDisplayValue(original);
			if (displayValue == null)
			{
				return false;
			}
			if (PropertyAdapter.GetIsEnum(original))
			{
				return (int)displayValue != ((ListControl)this).SelectedIndex;
			}
			if (displayValue is string)
			{
				return (string)displayValue != ((Control)this).Text;
			}
			return false;
		}
