			{
				base.List[index] = value;
			}
		}

		public bool IsValid
		{
			get
			{
				if (base.Count < 2)
				{
					return false;
				}
				if (this[0].Position != 0.0)
				{
					return false;
				}
				if (this[base.LastIndex].Position != 1.0)
				{
					return false;
				}
				return true;
			}
